import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import Documents from './components/docuements'; // Corrected import based on your filename
import History from './components/history';     // Corrected import
import LoginForm from './components/loginform';   // Corrected import
import Register from './components/register';     // Corrected import
import Suggestions from './components/suggestions'; // Corrected import
import Summary from './components/summary';       // Corrected import
import './App.css'; // Your main App CSS

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [username, setUsername] = useState('');

  useEffect(() => {
    // Check for token on component mount
    const token = localStorage.getItem('jwt_token');
    const storedUsername = localStorage.getItem('username');
    if (token && storedUsername) {
      // You might want to add token validation here (e.g., check expiry)
      setIsAuthenticated(true);
      setUsername(storedUsername);
    }
  }, []);

  const handleLogin = (token, user) => {
    localStorage.setItem('jwt_token', token);
    localStorage.setItem('username', user);
    setIsAuthenticated(true);
    setUsername(user);
    // history.push('/documents'); // Use navigate instead of history.push
  };

  const handleLogout = () => {
    localStorage.removeItem('jwt_token');
    localStorage.removeItem('username');
    setIsAuthenticated(false);
    setUsername('');
    // history.push('/login'); // Use navigate instead
  };

  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <Link to="/" className="navbar-brand">GarudaTaxAI</Link>
          <div className="navbar-links">
            {isAuthenticated ? (
              <>
                <span>Welcome, {username}</span>
                <Link to="/documents">Upload Documents</Link>
                <Link to="/history">Tax History</Link>
                <button onClick={handleLogout} className="logout-button">Logout</button>
              </>
            ) : (
              <>
                <Link to="/login">Login</Link>
                <Link to="/register">Register</Link>
              </>
            )}
          </div>
        </nav>

        <div className="main-content">
          <Routes>
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<LoginForm onLogin={handleLogin} />} /> {/* Use LoginForm */}
            
            {/* Protected Routes */}
            <Route
              path="/documents"
              element={isAuthenticated ? <Documents /> : <Navigate to="/login" />}
            />
            <Route
              path="/summary"
              element={isAuthenticated ? <Summary /> : <Navigate to="/login" />}
            />
            <Route
              path="/suggestions"
              element={isAuthenticated ? <Suggestions /> : <Navigate to="/login" />}
            />
            <Route
              path="/history"
              element={isAuthenticated ? <History /> : <Navigate to="/login" />}
            />
            {/* Redirect root to documents if authenticated, otherwise to login */}
            <Route
              path="/"
              element={isAuthenticated ? <Navigate to="/documents" /> : <Navigate to="/login" />}
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
